import axios from 'axios';

const instance = axios.create({
    baseurl: 'https://sandbox-api.coinmarketcap.com/v1/cryptocurrency/listings',
    headers: {
        'X-CMC_PRO_API_KEY': '26dc4fc8-165f-4abf-9c4f-4d5e7ae58aaa'
    },
});

export default{
    getData: () => 
    instance({
        'method' : 'GET',
        'url' : '/latest',
        'params' : {
            'symbols' : 'ETH'
        },
        transformResponse: [function(data){
            console.log(data);

            return {
                    'name' : data.id,
                    'price' : data.price_usd
                };
        }],
    })
}
